//material UI complete course
import {Button,Typography,IconButton} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import SendIcon from  '@mui/icons-material/Send';

function Mui() {
    return (
        <>
        {/* for heading paragraph (h1,h2,p etc) */}
            <Typography
                variant='h4'
                sx={{ color: 'red' }}
                component={'Home'}
                m={3}
            >
                we are learning MUI
            </Typography>
            <br/>

            {/* buttons */}

            <Button>click me</Button>
            <Button variant='contained'>click me</Button>
            <Button variant='text'>click me</Button>
            <Button variant='outlined'>click me</Button>
            <Button variant="contained" disableElevation>Disable elevation</Button>
            <Button disabled>Disabled</Button>
            <Button href="#text-buttons">Link</Button>
            <Button
                onClick={() => {
                    alert('clicked');
                }}
            >
                Click me
            </Button>

            <Button color="secondary" size="small">Secondary</Button>
            <Button variant="outlined" color="error" startIcon={<DeleteIcon />}> delete</Button>
            <Button variant="outlined" color="green" endIcon={<SendIcon />}> SEND</Button>

            <br />
            {/* icon btn */}
            
            <IconButton aria-label="delete" disabled color="primary">
               <DeleteIcon />
            </IconButton>

        </>
    )
}

export default Mui;
